import  '../components/Navbar.css';
const Navbar = ({sidebaropen,sidebarclosed}) => {
    return ( 
        <div className="navbar">

            <div className="navbar-left">

                <a href="">Home</a>
                <a href="">Home</a>
                <a href="" className="active-link">Home</a>
            </div>
            <div className="navbar-right">
            <a href="">
                <i className="fa fa-search"></i>
            </a>
            <a href="">
                <i className="fa fa-clock-o"></i>
            </a>
            <a href="" style={{marginTop:2}}><img src="http://i1.wp.com/www.teleplussolutions.com/wp-content/uploads/2015/02/avatar.png" width="50" height="40" /></a>
            </div>
        </div>
     );
}

export default Navbar;
